__NUXT_JSONP__("/svet/mesto/lobito", (function(a,b,c,d,e,f,g,h,i,j,k,l,m,n,o,p,q,r,s,t,u,v,w){return {data:[{place:[{id:k,id_state:l,name:m,population:205065,area:34.4,altitude:13,slug:n,information_chatgpt:a,coordinates:[{latitude:-12.3489,longitude:13.5456}],biggest:"yes",type_place:b,id_image_cover:a,id_image_hero:a,affiliate:[{name:o,value:g}],alerts:a,zoom:[{google:10,booking:11}],parking:a,information_author:a,importance:c,seo_tags:a,created_at:"2023-12-27T16:36:26.534285+00:00",updated_at:"2024-03-04T19:48:29.85915+00:00",name_original:a,setting_top:g,setting_status_public:f}],imagePlace:[],placeState:[{tld:".ao",name:"Angola",area:1246700,population:32866272,slug:p,id_continent:h,information_chatgpt:"\u003Cp\u003EAngola je země v jihozápadní Africe, která se rozkládá na území o velikosti přibližně 1,2 milionu kilometrů čtverečních. Má bohatou historii, která zahrnuje koloniální období a občanskou válku, ale dnes je Angola prosperující země s rostoucí ekonomikou a turistickým průmyslem.\u003C\u002Fp\u003E\n\u003Cp\u003EHlavním městem Angoly je Luanda, které se nachází na pobřeží Atlantského oceánu. Je to pulzující město s mnoha restauracemi, bary, klubem a trhy. Kromě toho je Angola známá svými nádhernými plážemi, jako jsou Ilha do Mussulo a Baía Azul, kde můžete relaxovat a užívat si slunce.\u003C\u002Fp\u003E\n\u003Cp\u003EAngola má také řadu přírodních krás, jako jsou národní parky Kissama a Quiçama, kde můžete vidět mnoho druhů zvířat, jako jsou sloni, levharti a krokodýli. Mezi další zajímavá místa patří skalnaté útesy Tundavala, vodopády Kalandula a krajina Namibské pouště.\u003C\u002Fp\u003E\n\u003Cp\u003EAngola má také bohatou kulturu a tradice, které se odrážejí v místní hudbě, tanci a umění. Můžete navštívit mnoho muzeí a galerií, abyste se dozvěděli více o historii a kultuře Angoly. Kromě toho můžete ochutnat mnoho místních jídel, jako je funge, moqueca a pirão.\u003C\u002Fp\u003E\n\u003Cp\u003EVzhledem k tomu, že Angola byla dlouho izolována kvůli občanské válce, stává se stále populárnější destinací pro turisty, kteří hledají dobrodružství a krásné přírodní scenérie. Pokud se chystáte do Angoly, určitě se těšte na nezapomenutelné zážitky a pohostinnost místních obyvatel.\u003C\u002Fp\u003E",money_prices:[{name:"Taxi (cena za km)",value:a,date_update:d},{name:"Hlavní jídlo",value:2600,date_update:d},{name:"Chleba",value:190,date_update:d},{name:"Mléko",value:q,date_update:d},{name:"Voda (500ml)",value:r,date_update:d},{name:"Espresso",value:300,date_update:d},{name:"Zmrzlina (jeden kopeček)",value:a,date_update:d},{name:"Pivo",value:250,date_update:d},{name:"Krabička cigaret",value:1000,date_update:d},{name:"Bic Mac",value:a,date_update:d},{name:"Coca Cola (500ml)",value:q,date_update:d}],phone_numbers_emergency:[{name:"Mezinárodní tísňová linka",value:"112",date_update:i},{name:"Policie",value:"113",date_update:i},{name:"Hasiči",value:"115",date_update:i},{name:"Zdravotnická záchranná služba",value:"116",date_update:i}],phone_prefix:"+244",coordinates:[{latitude:"-11.2027",longitude:"17.8739"}],people_religion:[{name:"křesťanství",value:80.1},{name:"tradiční náboženství",value:16.8},{name:"muslimové",value:1.4},{name:"jiné náboženství",value:.7},{name:"bez vyznání",value:.9}],people_nationality:[{name:"Angolští Bantuové",value:37},{name:"Ostatní africké národnosti",value:25},{name:"Křesťanští Portugalci a jejich potomci",value:s},{name:"Brazileští a portugalští potomci",value:f},{name:"Evropští neportugalští potomci",value:f},{name:"Indičtí a čínští potomci",value:f},{name:"Ostatní",value:33}],visitors_entry:[{name:"Občanský průkaz",value:"Občanský průkaz není platným cestovním dokladem pro vstup do Angoly. Je potřeba mít platný cestovní pas.",date_update:e},{name:"Cestovní pas",value:"Cestovní pas je potřebný pro vstup do Angoly. Musí být platný alespoň 6 měsíců od data příjezdu.",date_update:e},{name:"Vízum",value:"Pro vstup do Angoly je potřeba mít platné vízum. Vízum lze získat na ambasádě nebo konzulátu Angoly. Pro občany ČR je možné získat vízum při příjezdu na letišti v Angole, ale je nutné mít předem potvrzenou rezervaci ubytování a zpáteční letenku. Délka pobytu je omezena na 30 dní a lze ji prodloužit na místě. ",date_update:e},{name:"Očkování",value:"Při vstupu do Angoly není vyžadováno žádné specifické očkování, nicméně jsou doporučována očkování proti hepatitidě A a B, žloutence, meningitidě a dalším chorobám, které se vyskytují v této oblasti. Před cestou do Angoly je vhodné konzultovat s lékařem.",date_update:e},{name:"Cestovní pojištění",value:"Cestovní pojištění je doporučeno kvůli zdravotním rizikům spojeným s cestováním. V některých případech může být vyžadováno při vstupu do země.",date_update:e},{name:"Bezpečnostní situace",value:"Angola má stále zvýšenou kriminalitu, zejména v hlavním městě Luandě. Cestovatelům se doporučuje být opatrní a dbát na bezpečnostní opatření.",date_update:e},{name:"Další informace",value:"Při pobytu v Angole se doporučuje respektovat místní zvyklosti a tradice. Výměna peněz je nejlepší provádět na oficiálních směnárnách. Výměna peněz na ulici není doporučeno. Místní doprava v Luandě je často nebezpečná a mohou být v ní vysoká rizika pro cestovatele.",date_update:e}],type_place:t,id_image_cover:j,id_image_hero:j,id_city_main:u,affiliate:[{name:o,value:g}],mpz:"AO",alerts:[],zoom:[{google:h,booking:6}],ids_neighboring_countries:[{id:40},{id:42},{id:160},{id:248}],organization:[],apps:[],links:[],information_author:[],seo_tags:[],language_phrases:[],wall_sockets:a,id:l,facts_place:a,created_at:"2023-12-27T16:33:10.517062+00:00",updated_at:"2024-03-04T19:48:12.84066+00:00",name_original:a,currency:[{code:"AOA",name:"angolská kwanza"}],setting_top:g,setting_status_public:f}],imageState:[{id:j,name:p,source:"\u002Fworld\u002Fstates\u002F",type:t,author:"pixabay.com",created_at:"2023-04-10T23:51:59.681083+00:00",updated_at:"2023-12-27T20:42:18.520959+00:00"}],placeContinent:[{id:h,slug:"afrika",name:"Afrika",area:30370000,population:1340000000,population_density:44.12,number_states:54,information_chatgpt:"\u003Cp\u003EAfrika je největší kontinent na Zemi a rozkládá se na ploše přesahující 30 milionů kilometrů čtverečních. Nachází se zde více než 50 zemí a žije zde více než 1,3 miliardy lidí. \u003C\u002Fp\u003E\n\u003Cp\u003EJižní Afrika, Egypt, Maroko a Keňa patří mezi nejoblíbenější turistické cíle v Africe. V Jihoafrické republice se můžete podívat na slavné Krugerův národní park a sledovat zde život zvířat v jejich přirozeném prostředí. Egypt je zase proslulý svými pyramidami, které se nacházejí v Gíze. V Maroku můžete navštívit tradiční trhy, zatímco v Keni se můžete setkat s Masajským kmenem a podívat se na úžasnou přírodu.\u003C\u002Fp\u003E\n\u003Cp\u003EAfrika má bohatou historii a kulturu. První lidé, kteří se usadili v Africe, byli loveckým a sběračským národem. Poté se v této oblasti objevily první civilizace, jako je Kúšská říše, Egyptská říše nebo Království Aksum. Afrika byla také kolonizována evropskými mocnostmi a toto období mělo značný dopad na dnešní politickou situaci na kontinentu.\u003C\u002Fp\u003E\n\u003Cp\u003EJe důležité zmínit, že Afrika má velké množství jazyků a kultur. Zahrnuje mnoho různých národů a etnických skupin, a to má vliv na různorodost obyvatelstva a kultury. Nejrozšířenějším jazykem je arabština, která se mluví především v severní Africe a v některých částech západní Afriky. Dalšími důležitými jazyky jsou svahilština, francouzština, portugalština, angličtina a mnoho dalších.\u003C\u002Fp\u003E\n\u003Cp\u003EAfrika má také nádhernou přírodu. Nachází se zde nejvyšší hora světa, Kilimandžáro, která se nachází na území Tanzanie a Keňy. Kromě toho se v Africe nachází také největší pouště na světě, Sahara, a největší prales, Kongský prales. Na tomto kontinentě můžete vidět také mnoho zvířat, jako jsou sloni, lvi, gepardi, zebry a mnoho dalších druhů. V Africe se také nachází několik nejvýznamnějších řek světa, jako je Nil, Kongo, Niger a Zambezi.\u003C\u002Fp\u003E\u003Cp\u003EAfrika je bohužel také známá pro své problémy. Mnoho zemí se potýká s chudobou, nedostatkem potravin a vody, nemocemi a válečnými konflikty. Mnoho afrických zemí závisí na zemědělství a rybolovu, což však často není dostatečně výnosné, aby zabezpečilo potřeby obyvatelstva. Kromě toho jsou některé země v Africe trvale postižené extrémními přírodními katastrofami, jako jsou sucha, povodně a bouře.\u003C\u002Fp\u003E\n\u003Cp\u003ENa druhou stranu se v Africe také nachází mnoho lidí, kteří se snaží změnit situaci a zlepšit životy svých spoluobčanů. Vznikají neziskové organizace, které se snaží pomáhat při řešení těchto problémů a zlepšovat kvalitu života v mnoha afrických zemích. Zároveň se v posledních letech objevují nové možnosti pro ekonomický růst a rozvoj, jako jsou technologické start-upy a zahraniční investice.\u003C\u002Fp\u003E\n\u003Cp\u003EAfrika je fascinující kontinent, který nabízí mnoho zážitků a zároveň v sobě ukrývá mnoho výzev. Pokud se rozhodnete navštívit Afriku, můžete se těšit na krásnou přírodu, bohatou kulturu a nezapomenutelné zážitky. Je však také důležité být obezřetný a připravený na místní podmínky, protože některé oblasti mohou být nebezpečné kvůli konfliktům nebo zločinnosti.\u003C\u002Fp\u003E",coordinates:[{latitude:1.650801,longitude:17.371642}],type_place:"continent",id_image_cover:h,id_image_hero:h,zoom:[{google:s,booking:3}],information_author:[{text:"\u003Cp\u003E\u003Cb\u003EAfrika\u003C\u002Fb\u003E, druhý největší a druhý nejlidnatější kontinent na světě, láká cestovatele svou neuvěřitelnou rozmanitostí kultur, přírodními krásami a bohatou historií. Při cestování touto obrovskou plochou se otevírá mozaika různorodých zážitků, které zahrnují odlesky moderního městského života, divokou přírodu až po historická místa.\u003C\u002Fp\u003E\u003Cp\u003EJižní Afrika, domov několika národních parků a rezervací, je rájem pro milovníky safari. \u003Cb\u003EKrugerův národní park (Kruger National Park)\u003C\u002Fb\u003E nabízí úžasné setkání s \"Velkým pětkou\" - slony, nosorožci, buvoly, lvy a levharty. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fcape-town\"\u003EKapské Město (Cape Town)\u003C\u002Fa\u003E\u003C\u002Fb\u003E, s ikonickou horou \u003Cb\u003EMaclear's Beacon\u003C\u002Fb\u003E, poskytuje nezapomenutelný výhled na město a okolní krajinu.\u003C\u002Fp\u003E\u003Cp\u003EVýchodní Afrika je známá svými ohromujícími sopkami. \u003Cb\u003EKilimandžáro\u003C\u002Fb\u003E v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Ftanzanie\"\u003ETanzanii\u003C\u002Fa\u003E\u003C\u002Fb\u003E, nejvyšší hora Afriky, přitahuje dobrodruhy a horolezce z celého světa. Návštěva \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Ftanzanie\"\u003EZanzibaru\u003C\u002Fa\u003E\u003C\u002Fb\u003E s jeho bílými plážemi a historickým centrem \u003Cb\u003EStone Town\u003C\u002Fb\u003E přidává do cestovatelského mixu kouzlo exotiky.\u003C\u002Fp\u003E\u003Cp\u003EStřední Afrika, s obrovskou rovníkovou pralesní plochou, skrývá některé z nejzajímavějších biodiverzit na světě. \u003Cb\u003EKonžský deštný prales\u003C\u002Fb\u003E je po amazonském druhý největší na světě, je domovem vzácných druhů zvířat a rostlin, a expedice sem mohou odhalit tajemství dosud neobjevená.\u003C\u002Fp\u003E\u003Cp\u003ESeverní Afrika je poznamenána starověkými civilizacemi a písečnými pouštěmi. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fegypt\"\u003EEgypt\u003C\u002Fa\u003E\u003C\u002Fb\u003E s pyramidami a chrámy na březích \u003Cb\u003ENilu\u003C\u002Fb\u003E je jednou z nejnavštěvovanějších destinací v této části kontinentu. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fmaroko\"\u003EMaroko\u003C\u002Fa\u003E\u003C\u002Fb\u003E, s mistrovským spojením tradice a moderny v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fmarrakes\"\u003EMarrákeši\u003C\u002Fa\u003E\u003C\u002Fb\u003E, je fascinujícím mixem barev, vůní a architektury.\u003C\u002Fp\u003E\u003Cp\u003EZápadní Afrika, bohatá na kulturní dědictví, nabízí autentické zážitky. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fghana\"\u003EGhana\u003C\u002Fa\u003E\u003C\u002Fb\u003E s pevnostmi, které připomínají období otroctví, a kultovními festivaly představuje hluboký pohled do minulosti. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fsenegal\"\u003ESenegal\u003C\u002Fa\u003E\u003C\u002Fb\u003E, s historickým ostrovem \u003Cb\u003EGorée\u003C\u002Fb\u003E, který sehral roli s obchodem s otroky, kde najdete koloniální budovy a muzeum \u003Cb\u003EHouse of Slaves (Maison des esclaves)\u003C\u002Fb\u003E.\u003C\u002Fp\u003E\u003Cp\u003EAfrika je rovněž známá svými divokými zvířaty. Kromě safari v jižní části kontinentu můžete zažít jedinečnou příležitost sledovat migraci tisíců zeber a gazel v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fkena\"\u003EKeni\u003C\u002Fa\u003E\u003C\u002Fb\u003E a \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Ftanzanie\"\u003ETanzanii\u003C\u002Fa\u003E\u003C\u002Fb\u003E. Návštěva gorilí v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Frwanda\"\u003ERwandě\u003C\u002Fa\u003E\u003C\u002Fb\u003E nebo \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fuganda\"\u003EUgandě\u003C\u002Fa\u003E\u003C\u002Fb\u003E je neopakovatelným zážitkem pro ty, kteří touží po setkání s těmito ohroženými tvory.\u003C\u002Fp\u003E\u003Cp\u003EPřírodní skvosty nejsou omezeny pouze na pevninskou část kontinentu. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fseychely\"\u003ESeychely\u003C\u002Fa\u003E\u003C\u002Fb\u003E a \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fmauricius\"\u003EMauricius\u003C\u002Fa\u003E\u003C\u002Fb\u003E, dvě ostrůvky v \u003Cb\u003EIndickém oceánu\u003C\u002Fb\u003E, lákají svými bílými plážemi, průzračnými vodami a jedinečnou faunou a florou.\u003C\u002Fp\u003E\u003Cp\u003EAfrika rovněž hýří kulturou a historií. Starověké památky jako \u003Cb\u003EGreat Zimbabwe National Monument\u003C\u002Fb\u003E v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fzimbabwe\"\u003EZimbabwe\u003C\u002Fa\u003E\u003C\u002Fb\u003E nebo \u003Cb\u003ETimbuktu (Tombouctou)\u003C\u002Fb\u003E v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fmauricius\"\u003EMali\u003C\u002Fa\u003E\u003C\u002Fb\u003E jsou svědectvím o bohaté historii a rozvoji obchodu a kultury na africkém kontinentu. Každý region má své vlastní tradiční tance, hudbu a umění, které odrážejí místní identitu a historii.\u003C\u002Fp\u003E\u003Cp\u003ECestování Afrikou je také o interakci s místními lidmi. Přívětivost a pohostinnost afrických komunit jsou nezapomenutelnými součástmi cestování. Místní trhy nabízejí pestrou škálu barev, vůní a chutí, zatímco setkání s kmeny a etnickými skupinami přináší pochopení různorodosti kultur a tradic.\u003C\u002Fp\u003E\u003Cp\u003EJe však důležité si být vědomý sociálních, ekonomických a environmentálních výzev, kterým mnohé africké země čelí. Cestovatelé by měli být respektující vůči místním zvyklostem a životnímu prostředí a přispívat k udržitelnému turismu, který podporuje místní ekonomiky a ochranu přírodních zdrojů.\u003C\u002Fp\u003E\u003Cp\u003ECelkově lze říci, že cestování po Africe je dobrodružstvím naplněným kontrasty a překvapeními. Od rozlehlých savan po exotické pláže, od starověkých ruin po moderní metropole. Afrika nabízí cestovatelům nekonečné možnosti objevování a poznávání. Je to kontinent, který zanechává nezapomenutelný dojem na každém, kdo se odhodlá k jeho prozkoumání.\u003C\u002Fp\u003E",date_create:v,date_update:v,author_create:w,author_update:w}],seo_tags:[],created_at:"2023-12-27T16:35:37.460505+00:00",updated_at:"2024-03-04T19:48:06.634661+00:00",name_original:"Africa",setting_top:g,setting_status_public:f}],placesCities:[{id:74,id_image_cover:a,importance:c,slug:"benguela",type_place:b,name:"Benguela"},{id:79,id_image_cover:a,importance:c,slug:"cabinda",type_place:b,name:"Cabinda"},{id:72,id_image_cover:a,importance:c,slug:"huambo",type_place:b,name:"Huambo"},{id:75,id_image_cover:a,importance:c,slug:"kuito",type_place:b,name:"Kuito"},{id:k,id_image_cover:a,importance:c,slug:n,type_place:b,name:m},{id:u,id_image_cover:a,importance:c,slug:"luanda",type_place:b,name:"Luanda"},{id:76,id_image_cover:a,importance:c,slug:"malanje",type_place:b,name:"Malanje"},{id:77,id_image_cover:a,importance:c,slug:"namibe",type_place:b,name:"Namibe"},{id:78,id_image_cover:a,importance:c,slug:"soyo",type_place:b,name:"Soyo"},{id:r,id_image_cover:a,importance:c,slug:"uige",type_place:b,name:"Uíge"}],imagesCities:a}],fetch:{"OrganismsoPlaceTeaserSpotsComponent:0":{spots:[],images:a},"OrganismsoSidebarEventComponent:0":{events:[],images:a}},mutations:[]}}(null,"city","biggest","05-2021","04-2023",1,true,5,"09-2021",15,73,8,"Lobito","lobito","booking","angola",230,80,2,"state",71,"2024-03-01","1")));